# #はじめに
# 現代社会において、わたしたちの生活は大量のデータで溢れています。データを正しく解釈して、未来の活動に活かしていくという行為は、ビジネスの現場あるいは個人の生活においても大切な作業です。
# 
# 一方で、ひとつひとつのデータは無造作な数字でしかありません。それらを人間の解釈できる形にして、初めてデータは意味を持ちます。
# 
# 本稿では、データ可視化の方法について解説していきます。データのさまざまな表現方法を知ることで、「データをもとに伝える力」を身につけましょう。
# 
# 

# #棒グラフ
# 棒グラフはもっとも馴染み深いデータ可視化手法の一つです。比較したい項目間の数字の大小を比較するときに使います。「棒」の長短で、項目間の数字の大小を比較する事ができます。
# 
# 下記で実際にデータを可視化していき、注意点を解説していきます。ここでは、政府が提供している日本の人口データを使っていきます。
# 
# はじめに必要なライブラリを読み込みます。
# 

# In[ ]:


# ライブラリの読み込み
import pandas as pd
import plotly.express as px
import plotly.graph_objects as go


# 次にデータを読み込み、データの中身を確認します。

# In[ ]:


# データの読み込み
df=pd.read_csv('./FEH_00200521_240311192951.csv',encoding="shift-jis")
# データのカラム確認
df.info()

# データの表示
df


# データを観察してみると、「表章項目」に[人口、人口性比]の指標名、「男女_時系列」に[総数、男、女]の区分、「時間軸（調査年）」に調査年、「value」に表象項目の値が入っていることがわかります。
# 
# このデータを使ってグラフを作成する前に、データを可視化する目的を明確に定義しましょう。例えば、「2020年の人口が多い都道府県TOP3を特定したい」と思ったとします。
# 一般的な棒グラフは、
# - 縦軸：注目している数値
# - 横軸：比較したい項目
# 
# をプロットします。今回の例だと、
# 
# - 縦軸：2020年の人口の値
# - 横軸：都道府県
# 
# となります。
# 
# このように、グラフ作成時や作成したグラフを第三者に説明する際には、それぞれの軸が何を意味しているのかを明示すると誤認識を防ぐことができます。
# 
# それでは棒グラフを作成していきましょう。

# In[ ]:


# 可視化のためのデータ加工
## 条件の絞り込み
viz_df = df[(df['表章項目']=='人口') &
            (df['男女_時系列']=='総数') &
            (~df['地域_時系列'].isin(['全国', '人口集中地区', '人口集中地区以外の地区']))&
            (df['時間軸（調査年）']=='2020年')]
## 可視化する指標の型変換
viz_df = viz_df.assign(value = viz_df['value'].astype('int64'))

## 軸の名前を明示的に指定して可視化
fig=px.bar(viz_df, x='地域_時系列', y='value')
fig.update_layout(
    title='図1. 2020年の各都道府県の人口',
    xaxis=dict(title='都道府県'),
    yaxis=dict(title='人口'))


# 上の図をじっくり見ていくと、人口の多いTOP3の都道府県は東京・神奈川・大阪であることがわかりますが、直感的にわかりにくい状態になっています。そのため、人口の大きさで比較したい項目を並び替えて表示しましょう。

# In[ ]:


## ソート
sorted_viz_df = viz_df.sort_values(by='value',ascending=False)
## 軸の名前を明示的に指定して可視化
fig=px.bar(sorted_viz_df, x='地域_時系列', y='value')
fig.update_layout(
    title='図2. 2020年の各都道府県の人口',
    xaxis=dict(title='都道府県'),
    yaxis=dict(title='人口'))


# 今回の可視化の目的である「2020年の人口が多い都道府県TOP3を特定したい」という目的であれば、図2のグラフがわかりやすいです。一方で、「地理的に近隣の都道府県同士で2020年の人口を比べたい」という目的であれば、図1の棒グラフの見せ方のほうがわかりやすいです。このように同じ棒グラフでも、目的によって、見せ方の工夫すべきポイントが変わってくることもおさえておきましょう。
# 
# 棒グラフでは、時系列データも表現することができます。例えば、縦軸と横軸を
# - 縦軸：全国の人口の値（注目している数値）
# - 横軸：調査年（比較したい項目）
# 
# と定義して、棒グラフで表現する事が可能です。

# In[ ]:


## 条件の絞り込み
viz_df = df[(df['表章項目']=='人口') &
            (df['男女_時系列']=='総数') &
            (df['地域_時系列']=='全国')
            ]

## 可視化する指標の型変換
viz_df = viz_df.assign(value = viz_df['value'].astype('int64'))

## 軸の名前を明示的に指定して可視化
fig=px.bar(viz_df, x='時間軸（調査年）', y='value')
fig.update_layout(
    title='図3. 調査年ごとの人口',
    xaxis=dict(title='調査年'),
    yaxis=dict(title='人口'))


# このように、棒グラフは「注目したい数値」と「比較したい項目」を決めることで、横断面データ（一時点データ）と時系列データのどちらにも対応できる可視化手法です。

# #折れ線グラフ
# 折れ線グラフは、時系列データをグラフで表現する際に最も使われている可視化手法です。注目している数値の時間経過に伴う値の変化を可視化することができます。折れ線グラフでは、データ点同士を線で結ぶことにより、観測期間内における数値の平均変化率を線の傾きで表現できます。
# 
# ここから、実際にデータを可視化していき、注意点を解説していきます。
# はじめに、データを可視化する目的を定義しましょう。ここでは、「人口の推移を観察したい」と考えたとします。
# 
# 棒グラフのときと同様に、折れ線グラフでも軸の設定を明確にしていきましょう。
# - 縦軸：人口の値（注目している数値）
# - 横軸：調査年（比較したい値）
# 
# と整理することができます。
# 
# それでは実際に可視化していきましょう。

# In[ ]:


# 可視化のためのデータ加工
## 条件の絞り込み
viz_df = df[(df['表章項目']=='人口') &
            (df['男女_時系列']=='総数') &
            (df['地域_時系列']=='全国')]

## 数値以外の値を除去
viz_df = viz_df.assign(value=viz_df['value'].replace('-',None))
## 可視化する指標の型変換
viz_df = viz_df.assign(value = viz_df['value'].astype('int64'))

## 軸の名前を明示的に指定して可視化
fig=px.line(viz_df, x='時間軸（調査年）', y='value')
fig.update_layout(
    title='全国人口の推移',
    xaxis=dict(title='都道府県'),
    yaxis=dict(title='人口'))


# 図4から、
# - 2010年に人口増加のピークを迎え、そののちに減少に転じている
# - 1945年の人口が、前後の調査年と比べて少ない
# 
# ということがわかります。
# 
# そこで、実際に1945年のデータを観察してみましょう。

# In[ ]:


## 条件の絞り込み
check_df = df[(df['表章項目']=='人口') &
            (df['男女_時系列']=='総数') &
            (df['時間軸（調査年）']=='1945年')]
check_df


# 沖縄県のデータが欠損している事がわかります。1945年を調べてみると、第二次世界大戦末期の沖縄戦があった年であることがわかりました。戦場下にあって、人口調査が実施できなかったのではないかと推察できます。
# 
# このように折れ線グラフは、ある時点とある時点の間の値の平均変化率を「線の傾き」で表現することによって、データの推移を表現できます。
# 
# # 棒グラフと折れ線グラフの使い分け
# ここまでの説明で、棒グラフと折れ線グラフはどちらも時系列データを表現することができるとわかりました。それでは時系列データに対して、どのように使い分けるべきでしょうか。
# 
# 例えば、「四国4県の人口の推移を観察したい」と思ったとします。このときに、注目したい数値と比較したい項目を整理しましょう。
# - 注目したい数値：人口
# - 比較したい項目：調査年、**四国4県**
# 
# と整理できます。縦軸・横軸にはそれぞれ一つの項目しか設定できないので、四国4県は色で表現します。
# - 縦軸：人口（注目したい数値）
# - 横軸：調査年（比較したい項目）
# - 色：四国4県（比較したい項目）
# 
# 棒グラフと折れ線グラフそれぞれで比較してみましょう。

# In[ ]:


# 可視化のためのデータ加工
## 条件の絞り込み
viz_df = df[(df['表章項目']=='人口') &
            (df['男女_時系列']=='総数') &
            (df['地域_時系列'].isin(['香川県','愛媛県','徳島県','高知県']))]

## 数値以外の値を除去
viz_df = viz_df.assign(value=viz_df['value'].replace('-',None))
## 可視化する指標の型変換
viz_df = viz_df.assign(value = viz_df['value'].astype('int64'))

## 軸の名前を明示的に指定して可視化
fig=px.bar(viz_df, x='時間軸（調査年）', y='value', color='地域_時系列',barmode='group')
fig.update_layout(
      title='図5. 四国4県の人口推移',
      xaxis=dict(title='都道府県'),
      yaxis=dict(title='人口'))


# In[ ]:


## 軸の名前を明示的に指定して可視化
fig=px.line(viz_df, x='時間軸（調査年）', y='value', color='地域_時系列')
fig.update_layout(
    title='図6. 四国4県の人口推移',
    xaxis=dict(title='都道府県'),
    yaxis=dict(title='人口'))


# このように、時系列データを複数の項目で比較したいの場合には、折れ線グラフを採用するのが無難です。
# 
# ※色分けの要素数が多すぎると、折れ線グラフでも対応できない場合があるので注意
