# # (コラム)傾向線について
# エクセルなどの表計算ツールを使っていると、傾向線を引くオプションがあります。特に意識せずともそれらしいグラフを作成できますが、傾向線とはどのように作られているのでしょうか。
# 傾向線は、最小二乗法を適用することで得られる回帰直線を描画している場合がほとんどです。最小二乗法では、回帰直線と各データの誤差が最小になる直線を求めます。誤差は、(実際のデータの値 - 回帰直線の値)で計算できます。しかし、この計算方法だと誤差の値に正負両方の値が混在してしまい、計算するうえで扱いにくい状態です。そこで、誤差を二乗した値（二乗誤差）を使って計算していきます。「二乗誤差」を「最小」にする方法なので、「最小二乗法」なのです。

